import React from 'react';
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';

const Note = (props) => {

    const addEvent = (id) => {
        props.getNote(id)
    }

    return (
        <>
            <div className="note">
                <h1> {props.title} </h1>
                <br />
                <p>{props.content}</p>
                <button className="btn" onClick={() => {
                    addEvent(props.id);
                }}>
                    <DeleteOutlineIcon className="deleteIcon" />
                </button>
            </div>
        </>
    );
}

export default Note;
